  render() {
    return (
      <React.Fragment>
        <div>
          <h3>Player Board</h3>
          <div className="newBoard">
            <PlayerBoardGrid />
          </div>
        </div>
      </React.Fragment>
    );
  }
}

export default PlayerBoard;
